import React from 'react';

const landingPageStyle = {
  textAlign: 'center',
  padding: '50px',
};

const LandingPage = () => {
  return (
    <div style={landingPageStyle}>
      <h1>Welcome to Our Website</h1>
      <p>We offer amazing products and services.</p>
    </div>
  );
};

export default LandingPage;
